import Phaser from 'phaser'
import ObjectHandler from './ObjectHandler'

export default class TitleScreen extends Phaser.Scene {

    constructor() {
        super();
        this.objectHandler = new ObjectHandler();
        this.line;
        this.selectedSomething = false;
        this.lastClicked;
        this.objectTimerGroups;
        this.add_p_button;
        this.add_c_button;
    }

    addTaxi(scene, x, y) {
        var group = scene.add.container();
        var timer = scene.add.text(x, y, '0', {color: 0x006400})
        timer.name = '0'
        let cab = scene.add.sprite(x, y, 'cab');
        cab.setInteractive();
        cab.on('clicked', scene.cabClickHandler, scene);
        cab.setScale(0.1);
        this.objectHandler.register(cab)
        group.add([timer, cab])
        return group
    }

    addPassenger(scene, x, y) {
        var group = scene.add.container();
        var timer = scene.add.text(x, y, '0', {color: 0x006400})
        timer.name = '0'
        let p = scene.add.sprite(x, y, 'passenger');
        p.setInteractive();
        p.on('clicked', scene.passengerClickHandler, scene);
        p.setScale(0.2);
        this.objectHandler.register(p)
        group.add([timer, p]);
        return group
    }


    preload() {
        //images and other stuff has to get loaded in preload. else they will not be available when the browser
        //renders the game
        this.load.image('bg', "singapore.png");
        this.load.image('cab', "cab.png");
        this.load.image('cab_select', "cab_select.png");
        this.load.image('passenger', "passenger.png")
        this.load.image('passenger_select', "passenger_select.png")
        this.load.image('add_p_1', "add_passenger_1.png")
        this.load.image('add_p_2', "add_passenger_2.png")
        this.load.image('add_c_1', "add_cab_1.png")
        this.load.image('add_c_2', "add_cab_2.png")
    }

    create() {
        //create is a bit like "onLoad()" in html/js it gets called once in the beginning.
        // here we create the background image
        let image = this.add.image((this.cameras.main.width) / 2, (this.cameras.main.height) / 2, 'bg')
        let scaleX = this.cameras.main.width / image.width
        let scaleY = this.cameras.main.height / image.height
        let scale = Math.max(scaleX, scaleY)
        image.setScale(scale).setScrollFactor(0)

        //initialize the connector line which appears when we select a taxi
        this.graphics = this.add.graphics({lineStyle: {width: 5, color: 0xffa500}, fillStyle: {color: 0xffa500}});
        var line = new Phaser.Geom.Line(100, 200, 100, 100);
        this.line = line;
        this.graphics.visible = false;

        //initialize the group which stores all taxis/passengers
        this.objectTimerGroups = this.add.group();
        //here we create one cab and a passenger and add both to the object group
        this.objectTimerGroups.add(this.addTaxi(this, 400, 300))
        this.objectTimerGroups.add(this.addPassenger(this, 100, 200))

        //If we click on a game object, this fires the click event
        this.input.on('gameobjectup', function (pointer, gameObject) {
            gameObject.emit('clicked', gameObject);
        }, this);
        //if the line is displayed we update the position of the line according to the position of the mouse
        this.input.on('pointermove', function (pointer) {
            line.x2 = pointer.x
            line.y2 = pointer.y
        });

        // add "Add passenger" button to interface
        var add_p_button = this.add.sprite(100,718, 'add_p_1').setInteractive();
        add_p_button.setScale(0.2)
        add_p_button.on('pointerover',this.passengerButtonHoverIn, this);
        add_p_button.on('pointerout',this.passengerButtonHoverOut, this);
        add_p_button.on('clicked', this.passengerButtonClick,this);
        this.add_p_button = add_p_button;

        // add "Add cab" button to interface
        var add_c_button = this.add.sprite(300,718, 'add_c_1').setInteractive();
        add_c_button.setScale(0.2)
        add_c_button.on('pointerover',this.cabButtonHoverIn, this);
        add_c_button.on('pointerout',this.cabButtonHoverOut, this);
        add_c_button.on('clicked', this.cabButtonClick,this);
        this.add_c_button = add_c_button;
    }

    cabButtonHoverOut(){
        this.add_c_button.setTexture('add_c_1');
    }

    cabButtonHoverIn(){
        this.add_c_button.setTexture('add_c_2');
    }

    cabButtonClick(){
        var x = this.getRandomInt(1280 / 2)
        var y = this.getRandomInt(768 / 2)
        x = x + 50
        y = y + 50
        this.objectTimerGroups.add(this.addTaxi(this, x, y));
    }

    passengerButtonHoverOut(){
        this.add_p_button.setTexture('add_p_1');
    }

    passengerButtonHoverIn(button){
        this.add_p_button.setTexture('add_p_2');
    }

    passengerButtonClick(){
        var x = this.getRandomInt(1280 / 2)
        var y = this.getRandomInt(768 / 2)
        x = x + 50
        y = y + 50
        this.objectTimerGroups.add(this.addPassenger(this, x, y));
    }

    cabClickHandler(cab) //when the cab sprite gets clicked, we change the texture of it to cab_select
    {
        if (cab.texture.key === 'cab') {
            cab.setTexture('cab_select')
            cab.setScale(0.1)
            this.lastClicked = cab
            if (!this.selectedSomething) {
                this.graphics.visible = true;
                this.line.x1 = cab.x;
                this.line.y1 = cab.y;
                this.selectedSomething = true;
            }
        } else {
            cab.setTexture('cab')
            cab.setScale(0.1)
            this.graphics.visible = false;
            this.selectedSomething = false;
        }
    }

    passengerClickHandler(passenger) //same for passenger sprite
    {
        if (passenger.texture.key === 'passenger' && !this.selectedSomething) {
            passenger.setTexture('passenger_select')
            passenger.setScale(0.2)
            this.graphics.visible = true;
            this.line.x1 = passenger.x;
            this.line.y1 = passenger.y;
            this.selectedSomething = true;
            this.lastClicked = passenger;
        } else if (passenger.texture.key === 'passenger_select' && this.selectedSomething) {
            passenger.setTexture('passenger')
            passenger.setScale(0.2)
            this.graphics.visible = false;
            this.selectedSomething = false;
        } else if (passenger.texture.key === 'passenger' && this.selectedSomething) {
            this.graphics.visible = false;
            this.selectedSomething = false;
            passenger.parentContainer.getAt(0).visible = false;
            passenger.alpha = 0
            this.lastClicked.alpha = 0
            this.lastClicked.parentContainer.getAt(0).visible = false;
        }
    }

    //update gets called whenever the frame is rendered (which is very often)
    // time is the total run time of the app in ms and delta is the time since the last frame was rendered
    update(time, delta) {
        //rerender the line which appears when we selected a taxi
        this.graphics.clear();
        this.graphics.strokeLineShape(this.line);

        //update the waiting time counters
        var t = Math.floor(time)
        this.objectTimerGroups.getChildren().forEach(function (group) {
            var timer = group.getAt(0)
            var time = Number(timer.text)
            var frames = Number(timer.name)
            frames = frames + 1
            timer.name = "" + frames
            time = Math.floor(frames / 100)
            timer.text = "" + time
        }, this);

        //if the waiting time counter of an object is above a certain threshold, it changes style
        this.objectTimerGroups.getChildren().forEach(function (group) {
            var text = group.getAt(0)
            var time = Number(text.text)
            if (time > 2) {
                text.setStyle({fontSize: '20px', fillStyle: 0xb0000})
                text.setColor(0xb0000)
            }
        }, this);

        //*********For testing add taxis and passengers randomly **********
        // var z = t / (this.getRandomInt(t) + 1)
        // // console.log(z)
        // if (z > 1000) {
        //     var x = this.getRandomInt(1280 / 2)
        //     var y = this.getRandomInt(768 / 2)
        //     x = x + 50
        //     y = y + 50
        //     if (this.getRandomInt(2) == 0) {
        //         this.objectTimerGroups.add(this.addTaxi(this, x, y))
        //     } else {
        //         this.objectTimerGroups.add(this.addPassenger(this, x, y))
        //     }
        // }
        //*********************************************************************
    }

    getRandomInt(max) {
        return Math.floor(Math.random() * max);
    }
}
